from bs4 import BeautifulSoup

def extract_group_names_from_aria_label(html_content):
    """
    Extracts group names from HTML content by parsing the 'aria-label' attribute
    of <a> tags within specific <div> structures.

    Args:
        html_content (str): The HTML content to parse.

    Returns:
        list: A list of group names extracted from the HTML.
    """
    soup = BeautifulSoup(html_content, 'html.parser')
    group_names = []

    # Find all <a> tags with aria-label within the specified div structure
    group_links = soup.find_all(
        'a',
        attrs={'aria-label': True}
    )

    for link in group_links:
        aria_label = link.get('aria-label')
        if aria_label:
            # Extract the group name from the aria-label
            # Assuming the format is "Profile photo of group [GroupName]"
            if "Profile photo of group" in aria_label:
                group_name = aria_label.replace("Profile photo of group ", "").strip()
                group_names.append(group_name)

    return group_names

